import React from 'react';

export default function Underwater() {
  return (
    <div style={{padding: "20px"}}>
      <h2>水下监测系统</h2>
      <ul style={{listStyle: "none", padding: 0}}>
        <li style={{margin: "10px 0"}}> 摄像头阵列</li>
        <li style={{margin: "10px 0"}}> 声呐系统</li>
        <li style={{margin: "10px 0"}}> 温度传感器</li>
      </ul>
    </div>
  );
}
